import React from 'react';

const About = () => {
  return (
    <section id="about" className="py-20 px-6">
      <h2 className="text-4xl font-serif text-gold mb-6">About Me</h2>
      <p className="text-lg max-w-3xl text-white">
        I'm an MBA student at IIM Jammu with a Computer Science background and experience as a React Developer. My passion lies in bridging technology with business. I love solving real-world problems and designing impactful digital products.
      </p>
    </section>
  );
};

export default About;
